contract Hero is BEP721{
                        // variables
    address public owner;
    string public baseURI;
    uint public circulatingSupply;
    address[] public whitelistedPeople; // array  ✅
    uint public silverBox = 1;
    uint public goldenBox = 1;
    uint public platinumBox = 1;
    uint public diamondBox = 1;
    IBEP20 public HBG;

    uint256 public silverPrice;
    uint256 public goldPrice;
    uint256 public platinumPrice;
    uint256 public diamondPrice;

                        // structs
                        // Events 
    event buyNewBox(address user, string boxType);
                        // mappings
    mapping(uint => address) public ownerOfSilverBox;
    mapping(uint => address) public ownerOfGoldenBox;
    mapping(uint => address) public ownerOfPlatinumBox;
    mapping(uint => address) public ownerOfDiamondBox;
    mapping(uint => uint ) public start;

                        // constructor
    constructor(address _owner,IBEP20 _HBG) BEP721("HERO Token","HERO"){
        owner = _owner;
        HBG = IBEP20(_HBG);
    }
                        // modifiers
    modifier onlyOwner(){
        require(msg.sender == owner, "Only owner can run this function! ");
        _;
    }
                        // Readable Functions
    function checker() public view returns(address[] memory){
        address[] memory add = new address[](whitelistedPeople.length);
        for(uint256 i = 0; i < whitelistedPeople.length; i++){
            add[i] = whitelistedPeople[i];
        }
        return add;
    }

                        // Writeable Functions

                        ////////////////////
                        //   WHITE LIST   //
                        ////////////////////
    function addAddressToWhiteList(address[] calldata addresses) external onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++){
            whitelistedPeople.push(addresses[i]); 
        }
    }


    function endClaimHero()
        external
        onlyOwner
    {
        uint time = block.timestamp;
        for (uint256 i = 0; i < whitelistedPeople.length; i++){
            circulatingSupply+=1;
            _mint(whitelistedPeople[i], circulatingSupply);
            start[circulatingSupply] = time;
        }
    }

    function cleanWhiteList() public onlyOwner{
        delete whitelistedPeople;
    }

    function buyBox(address _user,uint _type, uint _payment) public {
        if(_type == 1 ){
            require(_payment >= silverPrice, "invalid Price ");
            ownerOfSilverBox[silverBox] = _user;
            silverBox+=1;
            HBG.transferFrom(_user, owner, _payment);
            circulatingSupply+=1;
            _mint(_user,circulatingSupply);
            start[circulatingSupply] = block.timestamp;
            emit buyNewBox(_user,"Silver");
        }else if(_type == 2){
            require(_payment == goldPrice, "invalid Price ");
            ownerOfGoldenBox[goldenBox] = _user;
            goldenBox+=1;
            HBG.transferFrom(_user, owner, _payment);
            circulatingSupply+=1;
            _mint(_user,circulatingSupply);
            start[circulatingSupply] = block.timestamp;
            emit buyNewBox(_user, "Golden");
        }else if(_type == 3){
            require(_payment == platinumPrice, "invalid Price ");
            ownerOfPlatinumBox[platinumBox] = _user;
            platinumBox+=1;
            HBG.transferFrom(_user, owner, _payment);
            circulatingSupply+=1;
            _mint(_user,circulatingSupply);
            start[circulatingSupply] = block.timestamp;
            emit buyNewBox(_user, "Platinm");
        }else if(_type == 4){
            require(_payment == diamondPrice, "invalid Price ");
            ownerOfDiamondBox[diamondBox] = _user;
            diamondBox+=1;
            HBG.transferFrom(_user, owner, _payment);
            circulatingSupply+=1;
            _mint(_user,circulatingSupply);
            start[circulatingSupply] = block.timestamp;
            emit buyNewBox(_user,"Diamond");
        }
    }

    //          Only Owner 

    function BurnNFT(uint token_No) external onlyOwner {
        require(block.timestamp > start[token_No] + 31536000 seconds, "Token's age must be older than 1 year.");
        _burn(token_No);
        start[++circulatingSupply] = 0;
    }
    function SetPrice(uint _silver, uint _gold, uint _platinum, uint _diamond) public onlyOwner {
        silverPrice = _silver;
        goldPrice = _gold;
        platinumPrice = _platinum;
        diamondPrice = _diamond;
    }
      // Hide identity or show identity from here
    function setBaseURI(string memory __baseURI) external onlyOwner {
        baseURI = __baseURI;
    }

    function _baseURI() internal view override returns (string memory) {
        return baseURI;
    }

    function ChangeOwner(address _owner ) public onlyOwner {
        owner = _owner;
    }

}

